import React, { Component } from 'react'

export default class PlayList extends Component {
  render() {
    return (
      <div className='PlayList'>
        <div className="header">
          <h1>当前播放</h1>
          <span>总100首</span>
        </div>
        
      </div>
    )
  }
}
